import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with domcontentloaded to avoid timeout
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and button to be visible
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.waitForSelector('.search-btn', { timeout: 5000 });

    // Enter XSS payload in search input
    const xssPayload = '<script>alert("XSS")</script>';
    await page.fill('#searchInput', xssPayload);

    // Take screenshot after entering payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Click search button using different selector strategy (class)
    await page.click('.search-btn');

    // Wait briefly for potential DOM changes
    await page.waitForTimeout(1000);

    // Take final screenshot after attempting XSS
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Check if payload appears in page content (indicates potential XSS vulnerability)
    const pageContent = await page.content();
    const isPayloadReflected = pageContent.includes(xssPayload);

    return {
      success: true,
      action: "Attempted XSS injection via search input with payload: " + xssPayload,
      extractedData: {
        payloadReflected: isPayloadReflected,
        payloadUsed: xssPayload
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete XSS attempt via search input",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
